import React from "react";
import { View, Button, StyleSheet, TouchableOpacity, Text } from "react-native";

TouchableOpacity.defaultProps = { activeOpacity: 0.8 };

const AppButton = ({ onPress, title, titleSmall }) => (
  <TouchableOpacity onPress={onPress}
  style={styles.appButtonContainer}>
    <Text style={styles.appButtonText}>{title}</Text>
    <Text style={styles.appButtonTextSmall}>{titleSmall}</Text>
  </TouchableOpacity>
);

const App = () => {
  return (
    <View style={styles.screenContainer}>
      <View style={styles.buttonThree}>
      <AppButton title="1" size="sm"
      titleSmall="O_O"
      backgroundColor="#007bff" />
      <AppButton title="2" size="sm"
      titleSmall="ABC"
      backgroundColor="#007bff" />
      <AppButton title="3" size="sm"
      titleSmall="DEF"
      backgroundColor="#007bff" />
      </View>
      <View style={styles.buttonThree}>
      <AppButton title="1" size="sm"
      titleSmall="O_O"
      backgroundColor="#007bff" />
      <AppButton title="2" size="sm"
      titleSmall="ABC"
      backgroundColor="#007bff" />
      <AppButton title="3" size="sm"
      titleSmall="DEF"
      backgroundColor="#007bff" />
      </View>
      <View style={styles.buttonThree}>
      <AppButton title="1" size="sm"
      titleSmall="O_O"
      backgroundColor="#007bff" />
      <AppButton title="2" size="sm"
      titleSmall="ABC"
      backgroundColor="#007bff" />
      <AppButton title="3" size="sm"
      titleSmall="DEF"
      backgroundColor="#007bff" />
      </View>
      <View style={styles.buttonThree}>
      <AppButton title="1" size="sm"
      titleSmall="O_O"
      backgroundColor="#007bff" />
      <AppButton title="2" size="sm"
      titleSmall="ABC"
      backgroundColor="#007bff" />
      <AppButton title="3" size="sm"
      titleSmall="DEF"
      backgroundColor="#007bff" />
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  screenContainer: {
    flex: 1,
    alignContent: "center",
    //justifyContent: "center",
    //padding: 16
  },
  appButtonContainer: {
    //elevation: 8,
    backgroundColor: "#ffffff",
    //borderRadius: 10,
    //paddingVertical: 10,
    //paddingHorizontal: 12
  },
  buttonThree: {
    flexDirection: 'row',
  },
  appButtonText: {
    color: "#000000",
    alignSelf: "center",
    //textTransform: "uppercase"
  },
  appButtonTextSmall: {
    fontSize: 10,
    color: "#000000",
    //fontWeight: "bold",
    alignSelf: "center",
    textTransform: "uppercase"
  }
});

export default App;
